import React from "react";
import Link from "next/link";
import Image from "next/image";

export default function projects() {
  return (
    <div className="container">
      <header>
        <style jsx>
          {`
            ul {
              list-style-type: none;
              margin-right: 2rem;
            }

            a {
              float: right;
              color: blue;
              text-align: center;
              padding: 10px;
              text-decoration: none;
              font-size: 20px;
              line-height: 35px;
              border-radius: 4px;
              display: block;
            }

            header {
              overflow: hidden;
              background-color: lightblue;
              position: fixed;
              top: 0;
              width: 100%;
              float: right;
              padding: 5px 5px;
            }

            .flex-container {
                text-align: center;
                display: flex;
                flex-direction: row;
                align-items: center;
                width: 100%;
                height: 100vh;
                font-size: 20px;
              }

              .flex-item-left {
                background-color: #f39b6d;
                flex: 50%;
                width: 300px;
                padding: 30px;
              }

              .flex-item-right {
                background-color: #41e2ba;
                flex: 50%;
                width: 300px;
                padding: 30px;
              }
          `}
        </style>
        <nav>
          <ul>
            <Link href="/contact">
              <a>Contact</a>
            </Link>
            <Link href="/projects">
              <a>Projects</a>
            </Link>
            <Link href="/about">
              <a>About Me</a>
            </Link>
            <Link href="/">
              <a>Home</a>
            </Link>
          </ul>
        </nav>
      </header>
      <div className="bugs">
        <Image
          src="/static/bugs.svg"
          alt=""
          width={500}
          height={500}
          className="bugs"
        />
      </div>
      <div className="flex-container">
          <style jsx global>{`
            body {
              background: lightblue;
            }
            .bugs {
              align-items: center;
            }


            .bugs {
              text-align: center;
              padding: 5%;
            }
          `}</style>
           <div className="flex-item-left">
          <h4>Javascript Calculator</h4>

          <p>
            I created this calculator with vanilla JavaScript, HTML and CSS for
            my task during my bootstrap with hyperionDev
          </p>

          <a
            href="https://testcalculator.netlify.app/"
            className="button button2"
            target="blank"
          >
            Click Here
          </a>
        </div>
      </div>

      <div className="flex-item-right">
        <h4> Online Store</h4>
        <p className="">
          This is a online store with add to cart functionality, you can add
          items to cart and remove it at will.
        </p>
        <a
          href="https://testonlinestore.netlify.app/"
          className="button button1"
          target="blank"
        >
          Click Here
        </a>
      </div>
    </div>
  );
}
